import React, { Component } from 'react';
import { Redirect } from "react-router-dom";

class CadastroProduto extends Component{
    constructor(){
        super();

        this.state = {
            produto: {
                codigo: 0,
                nomeDoLivro: "",
                autor: "",
                quantidadeEstoque: 0,
                vendidos: 0,
                status: ""
            },
            Redirect: false,
        }
    }
}
